import React from "react";
import Section from "./Section";

const Footer = (props) => (
  <Section>
    <div>
      <div className="padding"><hr /></div>
        <div className="footer-links">
            <p><a href="#"><strong>Blog</strong></a></p>
            <p><a href="#"><strong>Projects</strong></a></p>
            <p><a href="#"><strong>Media</strong></a></p>
            <p><a href="#"><strong>Contact</strong></a></p>
        </div>
    </div>
  </Section>
);

export default Footer;
